apiVersion: primehub.io/v1alpha1
kind: PhAppTemplate
metadata:
  name: openvino-notebooks
  annotations:
    helm.sh/hook: post-install, post-upgrade
spec:
  name: OpenVINO Notebooks
  description: A collection of ready-to-run Jupyter notebooks for learning and experimenting with the OpenVINOâ„¢ Toolkit. 
  version: 20221119-v1
  docLink: https://github.com/openvinotoolkit/openvino_notebooks
  icon: data:image/png;base64,
  template:
    spec:
      podTemplate:
        spec:
          containers:
          - name: openvino-notebooks
            image: infuseai/primehub-apps:openvino-notebook-20221119-v1
            command:
            - bash
            - -c
            args:
            - export SHELL=/bin/bash; jupyter lab --config=/opt/app-root/etc/jupyter_server_config.py --NotebookApp.allow_origin=${PRIMEHUB_URL} --ip 0.0.0.0 --NotebookApp.base_url=$(PRIMEHUB_APP_BASE_URL) --NotebookApp.notebook_dir=${PRIMEHUB_APP_ROOT} --NotebookApp.token=""
            ports:
            - containerPort: 8888
              name: http
              protocol: TCP
      svcTemplate:
        spec:
          ports:
          - name: http
            port: 8888
            protocol: TCP
            targetPort: 8888
      httpPort: 8888